PcPageExpr.Expression:
            string fgprefix = "";
            string fgsuffix = "";
            string fgdesc = "";
            string coretype = "";
            string prodgroup = "";
            string sumsalescat = "";

            fgprefix = "";
            fgsuffix = "";
            fgdesc = "";
            coretype = "";
            prodgroup = "";
            sumsalescat = "";

            Inputs.dec_price.Value = 0;

            /* FG Number determination ************************************************************************************************************************************************************/

            fgprefix = PCLookUp.DataLookup("TBSSignHolderType", "fg_prefix", Inputs.cmb_type.Value);
						fgsuffix = PCLookUp.DataLookup("TBSSignHolderFrameOption", "fg_suffix", Inputs.cmb_frame.Value);

            Inputs.var_fgnum.Value = fgprefix + fgsuffix;
						bool available_part = false;

            /* Return description from Epicor Parts Master Record */
						available_part = UDMethods.GetPartDescription(Context.CompanyID, Inputs.var_fgnum.Value, out fgdesc);

            if (fgdesc == "") { Inputs.var_fgdesc.Value = "** ERROR ** FG number not found in the Epicor parts master table."; }
            if (fgdesc != "") { Inputs.var_fgdesc.Value = fgdesc; }

            /*this is for sales price*/
						decimal UnitPrice = 0m;
						string PartNum = "";

						available_part = UDMethods.GetPartPrice(Context.CompanyID, Inputs.var_fgnum.Value, out UnitPrice);
            if (available_part) {
                Inputs.dec_price.Value = UnitPrice;
            }

            /* Set standard Warranty Code */
            string warranty = "";
            warranty = PCLookUp.DataLookup("TENUK_FG_MasterTable", "std_warranty", Inputs.var_fgnum.Value);
            if (warranty == "") { Inputs.chr_warranty.Value = "2YR"; }
            if (warranty != "") { Inputs.chr_warranty.Value = warranty; }


            /* Smart Code string generation **********************************************************************************************************************************************************/

            if (Inputs.cmb_coresolution.Value == "Core") { coretype = "COR"; }
            if (Inputs.cmb_coresolution.Value == "Solution") { coretype = "SOL"; }

            if (Inputs.cmb_sumsalescat.Value == "Core") { sumsalescat = "COR"; }
            if (Inputs.cmb_sumsalescat.Value == "Solution") { sumsalescat = "SOL"; }

            prodgroup = "DAS";

            Inputs.var_smartstring.Value = sumsalescat + "|" + coretype + "-" + prodgroup + "|" + Inputs.var_fgnum.Value + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + "XXX" + "|" + Inputs.var_sectorcode.Value;

            Inputs.var_smart1.Value = coretype + "-" + prodgroup;
            Inputs.var_smart2.Value = Inputs.var_sectorcode.Value;


            /* Net Weight for Intrastat **********************************************************************************************************************************************************/

            /* Calculates Net Weight */

            decimal CompWeight1 = 0m;
						decimal PartWeight = 0m;

            CompWeight1 = 0;

            if (Inputs.var_fgnum.Value != "")
            {
								available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_fgnum.Value, out PartWeight);
            }
            if (available_part) {
                CompWeight1 = PartWeight;
            }

            /* Totals the individual component weights */
            Inputs.var_netweight.Value = CompWeight1;


            /* Validity Routines **********************************************************************************************************************************************************/

            /* FG Description validation */
            if ((Inputs.var_fgdesc.Value == "** ERROR ** FG number not found in the Epicor parts master table.") && (Inputs.chk_erroron.Value == true))
            {
								MessageBox.Show("The Part does not exist in the Parts Master table, contact the Operations department.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
								PageLeaveFunctions.SetNextInputPage(1);
								Args.Cancel = true;

            }

            if ((Inputs.cmb_coresolution.Value != "") && (Inputs.cmb_sector.Value != ""))
            {
                PageLeaveFunctions.SetNextInputPage(2);
            }

            /* Checks if FG Number passed to sales line is less than 50 Characters */
            decimal smartcount = 0m;
            smartcount = 0;
            smartcount = Inputs.var_smart2.Value.Length;
            if (smartcount > 50)
            {
								MessageBox.Show("The Finished Goods Number exceeds the Maximum number of Characters allowed in the Sales Line Part Number Field......", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
								PageLeaveFunctions.SetNextInputPage(1);
								Args.Cancel = true;

            }

            /* Returns Commodity Code from CSV */
            Inputs.var_commodity.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", "commodity_code", Inputs.var_fgnum.Value);


            /* If no commodity code is returned from the CSV file it checks the parts master table */
            string partclass = "";
            partclass = "";
            if (Inputs.var_commodity.Value == "")
            {
								available_part = UDMethods.GetPartClass(Context.CompanyID, Inputs.var_fgnum.Value, out partclass);
            }

            /* As Part Class is used to assign Commodity Code */
						string commodityID = "";
            if ((Inputs.var_commodity.Value == "") && (partclass != ""))
            {
								available_part = UDMethods.GetPartClassCommodity(Context.CompanyID, partclass, out commodityID);
								if( available_part)
									Inputs.var_commodity.Value = commodityID;
            }

						bool available_ICommCode = false;

            /* Verifies Commodity code exists in IComCode Table within Epicor */
            string commoditycheck = "";
            commoditycheck = "";
            if (Inputs.var_commodity.Value != "")
            {
                available_ICommCode = UDMethods.GetICommImportCode(Context.CompanyID, Inputs.var_commodity.Value, out commoditycheck);
            }

            if (Inputs.var_commodity.Value == "")
            {

								MessageBox.Show("The Configurator has been unable to determine the Commodity Code for the chosen configuration. Please contact the Operations department.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
								PageLeaveFunctions.SetNextInputPage(1);
								Args.Cancel = true;

            }

            if (Inputs.var_commodity.Value != commoditycheck)
            {

								MessageBox.Show("The Configurator has assigned a Commodity code that does not have a corresponding Epicor record, please contact the Operations department to correct this error.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
								PageLeaveFunctions.SetNextInputPage(1);
								Args.Cancel = true;

            }

            if ((Inputs.cmb_coresolution.Value == "") || (Inputs.cmb_sumsalescat.Value == "") || (Inputs.cmb_sector.Value == ""))
            {
								MessageBox.Show("You have not entered all the mandatory requirements.....", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
								PageLeaveFunctions.SetNextInputPage(1);
								Args.Cancel = true;

            }
            else if ((Inputs.cmb_coresolution.Value != "") || (Inputs.cmb_sumsalescat.Value != "") || (Inputs.cmb_sector.Value != ""))
            {
                PageLeaveFunctions.SetNextInputPage(2);
            }

            /* ********************************************************************************************************************************************************************************** */

            /* Pack Comment */

            string Mode = "";
            int CustID = 0;
            int OrderNum = 0;
            int QuoteNum = 0;
            string CustCountry = "";
            string CustName = "";
            string OTSID = "";
            bool OTS = false;
            int OTSCountry = 0;

            /* Determines Current Configuration Mode and order/quote specifics */
            Mode = Context.Entity;
            CustID = 0; /* Set to Zero when not used for testing*/
            CustCountry = "";
            OrderNum = Context.OrderNumber;
            QuoteNum = Context.QuoteNumber;

						bool available_QuoteHed = false;
						bool available_OrderHed = false;
						bool available_Country = false;
						bool available_ShipTo = false;
						bool available_Customer = false;

            /* ********************************************************************************************************************************************************************************** */
            if (Mode == "Quote")
            {

								/* Retrieve details from Quote Header */
				        bool result = UDMethods.GetQuoteHed(Context.CompanyID, QuoteNum, out CustID, out OTSID, out OTS);

                /* Retrieve details from Quote Header */
			          if (available_QuoteHed)
			          {
									Inputs.var_custid.Value = CustID;
			          }

                /* Retrieves customer name using customer ID */
								available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry);

                /* ************************************************************** */

			          /* If a saved shipto address is specified gets country info */
			          if (OTSID != "")
			          {
			              available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
			              available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);
			          }

                Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + QuoteNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
                Inputs.var_shipcountry.Value = CustCountry;

						}


            /* ********************************************************************************************************************************************************************************** */
            if (Mode == "Order")
            {
								/* Retrieve details from Order Header */
			          available_OrderHed = UDMethods.GetOrderHed(Context.CompanyID, OrderNum, out CustID, out OTSID, out OTS);

                /* Retrieve details from Order Header */
                if (available_OrderHed) {
                    Inputs.var_custid.Value = CustID;
                }

                /* Retrieves customer name using customer ID */
                available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry); 

                /* ************************************************************** */

			          /* If a saved shipto address is specified gets country info */
			          if (OTSID != "")
			          {

			              available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
										available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);

			          }

                Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + OrderNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
                Inputs.var_shipcountry.Value = CustCountry;
						}

            /* ********************************************************************************************************************************************************************************** */
            if (Mode == "PcStatus")
            {

                Inputs.var_orderdtl.Value = "Mode: " + Mode;
                /* Inputs.var_shipcountry.Value = "Albania". */

                Inputs.var_custid.Value = 11131;

            }

            /* ********************************************************************************************************************************************************************************** */

            string palletlookup = "";

            palletlookup = "";

            /* Finds Pallet lookup from csv based on Shipping country*/
            palletlookup = PCLookUp.DataLookup("CountryPalletList", "pallet_type", Inputs.var_shipcountry.Value);

            if (palletlookup != "")
            {
                Inputs.var_palletlookup.Value = palletlookup + "_Lookup";
                Inputs.var_packcomment.Value = PCLookUp.DataLookup("CountryPalletList", "default_message", Inputs.var_shipcountry.Value);
            }

            if (palletlookup == "") { Inputs.var_palletlookup.Value = "All_Lookup"; }
